        [1719] = {2500340,"","Khi tướng địch bị diệt, Thủy Kính có xác suất 35% thi triển kỹ năng một lần nữa, kỹ năng này không tốn nộ khí, sát thương bằng 40% ban đầu.",},
        [1720] = {2500540,"","Khi tướng địch bị diệt, Thủy Kính có xác suất 35% thi triển kỹ năng một lần nữa, kỹ năng này không tốn nộ khí, sát thương bằng 40% ban đầu.",},
        [1721] = {2500041,"","Địch và ta cứ mỗi lần tử vong 1 mục tiêu, sát thương Thủy Kính tăng 8%.",},
        [1722] = {2500399,"Sóng Gió","Gây 126% ST phép thuật cho địch 2 hàng dọc, bản thân hồi 2 nộ. (Ưu tiên hàng có nhiều mục tiêu)",},
        [1723] = {2500499,"Sóng Gió","Gây 126% ST phép thuật cho địch 2 hàng dọc, bản thân hồi 2 nộ. (Ưu tiên hàng có nhiều mục tiêu)",},
        [1724] = {2510020,"Diệu Liên","Gia Cát Quả được bảo vệ, miễn dịch Câm Lặng, Tê Liệt. Mỗi lần hành động sẽ thi triển kỹ năng, giúp tất cả tướng Thục phe ta tăng 12% sát thương và 12% Giảm ST, duy trì 2 lượt (Kỹ năng này không tốn nộ). Gia Cát Quả mỗi lần hành động sẽ không tính vào lượt hành động phe ta.",},
        [1725] = {2510040,"","Gia Cát Quả được bảo vệ, miễn dịch Câm Lặng, Tê Liệt. Gia Cát Quả mỗi lần hành động sẽ không tính vào lượt hành động phe ta.",},
        [1726] = {2510140,"","Khi cả lượt phe ta kết thúc, Gia Cát Quả sẽ dùng hết nộ đang có, hồi nộ cho các võ tướng Thục khác của phe ta. (Gia Cát Quả tốn 2 nộ sẽ giúp các tướng Thục khác hồi 1 nộ, tối đa tốn 4 nộ. Gia Cát Quả còn dưới 2 nộ sẽ không thể kích hoạt).",},
        [1727] = {2510340,"","Khi chịu hiệu quả trực tiếp từ Thần Thú, bản thân hồi 1 nộ, 2 tướng sinh lực thấp nhất phe ta nhận Hộ Thuẫn hấp thu sát thương bằng 16% sinh lực tối đa của Gia Cát Quả, duy trì 1 lượt (Mỗi lượt tối đa 2 lần)",},
        [1728] = {2510540,"","Khi võ tướng Thục khác của phe ta dùng kỹ năng, Gia Cát Quả 100% hồi 1 nộ (Mỗi mục tiêu mỗi lượt tối đa 2 lần). Khi võ tướng Thục khác của phe ta đánh thường, Gia Cát Quả 100% hồi 1 nộ (Mỗi lượt tối đa 4 lần).",},
        [1729] = {2510041,"","Mỗi lượt bản thân hồi 1 nộ. Khi bị hiệu quả Choáng, Đánh Bay, Áp Chế, Trúng Độc, Thiêu Đốt, có thể dùng 2 nộ xóa 1 lần hiệu quả này",},
