        [3751] = {7063020,"Long Nộ","Tăng cho  toàn đội 1 nộ, ST 12%, duy trì 1 lượt.",},
        [3752] = {7064020,"Long Nộ","Tăng cho  toàn đội 1 nộ, ST 12% và chính xác 12%, duy trì 1 lượt.",},
        [3753] = {7065020,"Long Nộ","Tăng cho  toàn đội 1 nộ, ST 12% và chính xác 12%, bạo kích 12%, duy trì 1 lượt",},
        [3754] = {7060120,"Thần-Long Nộ","Thi triển kỹ năng giúp toàn đội hồi 1 nộ, sát thương tất cả phe ta tăng 12%, ST bạo kích tất cả Võ Tướng phe ta tăng 8%, duy trì 1 lượt. Kèm 1 ký hiệu Thanh Long cho 2 mục tiêu nộ khí thấp nhất, duy trì 1 lượt. Trước khi tướng hành động, ký hiệu Thanh Long sẽ giúp mục tiêu hồi 1 nộ khí (Khi mục tiêu có ký hiệu hành động ở lượt khác, có thể kích hoạt hiệu quả ký hiệu)",},
        [3755] = {7060220,"Thần-Long Nộ","Thi triển kỹ năng giúp toàn đội hồi 1 nộ, sát thương tăng 12% và chính xác 12%, sát thương bạo kích của tướng tăng 12%, duy trì 1 lượt. Kèm 1 ký hiệu Thanh Long cho 2 mục tiêu có nộ khí thấp nhất, duy trì 1 lượt. Trước khi tướng hành động, ký hiệu Thanh Long sẽ giúp mục tiêu hồi 1 nộ khí (Khi mục tiêu có ký hiệu hành động ở lượt khác, có thể kích hoạt hiệu quả ký hiệu)",},
        [3756] = {7060320,"Thần-Long Nộ","Thi triển kỹ năng giúp toàn đội hồi 1 nộ, sát thương tất cả phe ta tăng 12%, chính xác tăng 12%, tỉ lệ bạo kích tăng 12%, ST bạo kích tất cả Võ Tướng phe ta tăng 16%, duy trì 1 lượt. Kèm 1 ký hiệu Thanh Long cho 2 mục tiêu nộ khí thấp nhất, duy trì 1 lượt. Trước khi tướng hành động, ký hiệu Thanh Long sẽ giúp mục tiêu hồi 2 nộ khí (Khi mục tiêu có ký hiệu hành động ở lượt khác, có thể kích hoạt hiệu quả ký hiệu)",},
        [3757] = {7060420,"Thần-Long Nộ","Thi triển kỹ năng giúp toàn đội hồi 1 nộ, sát thương toàn phe ta tăng 12%, chính xác tăng 12%, bạo kích tăng 12%, ST bạo kích Võ Tướng toàn phe ta tăng 20%, duy trì 1 lượt. Kèm ký hiệu Thanh Long cho 3 mục tiêu nộ thấp nhất, duy trì 1 lượt. Ký hiệu Thanh Long hồi 2 nộ khí cho mục tiêu trước khi Võ Tướng hành động (Mục tiêu bị ký hiệu khi hành động không theo lượt, sẽ kích hoạt hiệu quả)",},
        [3758] = {7060520,"Thần-Long Nộ","Thi triển kỹ năng giúp toàn đội hồi 1 nộ, sát thương tất cả phe ta tăng 12%, chính xác tăng 12%, tỉ lệ bạo kích tăng 12%, ST bạo kích tất cả Võ Tướng phe ta tăng 24%, duy trì 1 lượt. Kèm 1 ký hiệu Thanh Long cho 3 mục tiêu nộ khí thấp nhất, duy trì 2 lượt. Trước khi tướng hành động, ký hiệu Thanh Long sẽ giúp mục tiêu hồi 2 nộ khí (Khi mục tiêu có ký hiệu hành động ở lượt khác, có thể kích hoạt hiệu quả ký hiệu)",},
        [3759] = {7070010,"Phần Thiên","Sau khi Tung Hỏa Tướng thi triển kỹ năng, Chu Tước khiến toàn thể mục tiêu bị thiêu đốt chịu sát thương bằng 10% sinh lực tối đa, mỗi lượt được thi triển tối đa 1 lần",},
