        [3761] = {7070210,"Phần Thiên","Sau khi Tung Hỏa Tướng thi triển kỹ năng, Chu Tước khiến toàn thể mục tiêu bị thiêu đốt chịu sát thương bằng 18% sinh lực tối đa, mỗi lượt được thi triển tối đa 1 lần",},
        [3762] = {7070310,"Phần Thiên","Chu Tước khiến phe địch bị Thiêu Đốt 18% sinh lực tối đa, mỗi lượt 1 lần. Tướng Ngô phe ta nhận hiệu quả Nghiệp Viêm 1 lượt, tăng 10% sát thương gây ra",},
