        [3764] = {7070510,"Phần Thiên","Chu Tước khiến phe địch bị Thiêu Đốt 18% sinh lực tối đa, mỗi lượt 1 lần. Tướng Ngô phe ta nhận hiệu quả Nghiệp Viêm 1 lượt, tăng 20% sát thương gây ra",},
