        [3766] = {7071120,"Thần-Phần Thiên","Chu Tước khiến phe địch bị Thiêu Đốt 18% sinh lực tối đa, mỗi lượt 1 lần. Tướng Ngô phe ta nhận hiệu quả Nghiệp Hỏa 1 lượt, tăng 20% sát thương gây ra, khi Tung Hỏa Tướng tử vong, Chu Tước gây sát thương 10% sinh lực tối đa lên kẻ địch bị Thiêu Đốt, mỗi trận tối đa 1 lần.",},
