        [3834] = {7201010,"Vô Ưu Tiên Nhạc","Giai đoạn bắt đầu chiến đấu, kèm ký hiệu Sương Mù cho toàn bộ phe ta. Khi mục tiêu hành động, chọn phe, nếu cùng phe, Võ Tướng nhận hiệu quả Ngự Giáp bằng 30% HP tối đa bản thân, sau đó ký hiệu Sương Mù biến mất. (Khi chọn phe thất bại, ký hiệu không biến mất)",},
        [3835] = {7201020,"Vô Ưu Tiên Nhạc","Giai đoạn bắt đầu chiến đấu, kèm ký hiệu Sương Mù cho toàn bộ phe ta. Khi mục tiêu hành động, chọn phe, nếu cùng phe, Võ Tướng nhận hiệu quả Ngự Giáp bằng 50% HP tối đa bản thân, sau đó ký hiệu Sương Mù biến mất. (Khi chọn phe thất bại, ký hiệu không biến mất)",},
        [3836] = {7201030,"Vô Ưu Tiên Nhạc","Giai đoạn bắt đầu chiến đấu, kèm ký hiệu Sương Mù cho toàn bộ phe ta. Khi mục tiêu hành động, chọn phe, nếu cùng phe, Võ Tướng nhận hiệu quả Ngự Giáp bằng 50% HP tối đa bản thân, sau đó ký hiệu Sương Mù biến mất. Trong thời gian duy trì, mục tiêu chịu sát thương chí mạng sẽ không tử vong mà chỉ còn 1 HP, nhận hiệu quả Ngự Giáp bằng 50% HP tối đa bản thân, sau đó ký hiệu Sương Mù biến mất. (Khi chọn phe thất bại, ký hiệu không biến mất)",},
        [3837] = {8091010,"","[ Phi Sương] Khi tấn công chuyển 20% ST tướng địch thành HP trị liệu tướng ít HP nhất phe ta.",},
        [3838] = {8092010,"","[Phi Sương] Chuyển hóa 30% ST gây ra cho Tướng địch thành HP, trị liệu Tướng phe ta có HP thấp nhất, hồi thêm cho bản thân HP bằng 10% HP tối đa.",},
        [3839] = {8093010,"","[Phi Sương] Chuyển hóa 30% ST gây ra cho Tướng địch thành HP, trị liệu Tướng phe ta có HP thấp nhất, hồi thêm cho bản thân HP bằng 30% HP tối đa.",},
        [3840] = {8101010,"","[Chiếu Dạ] Tấn công tăng ST thêm cho địch 16%.",},
        [3841] = {8102010,"","[Chiếu Dạ] Tấn công tăng ST thêm cho địch 25%, diệt mục tiêu có 50% hồi 1 nộ khí.",},
        [3842] = {8103010,"","[Chiếu Dạ] Tấn công tăng ST thêm cho địch 25%, diệt mục tiêu bản thân hồi 1 nộ khí, lượt sau sẽ hồi thêm 1 nộ khí",},
        [3843] = {8111010,"","[Hỏa Long] Hiệu quả trị liệu tăng 10% đối với mục tiêu bị cấm trị liệu, giúp mục tiêu thêm 1 hộ thuẫn hút sát thương liên tục trong 1 lượt, hút sát thương bằng 40% lượng trị liệu",},
        [3844] = {8112010,"","[Phong-Hỏa Long] Hiệu quả trị liệu tăng 18% đối với mục tiêu bị cấm trị liệu, giúp mục tiêu thêm 1 hộ thuẫn hút sát thương liên tục trong 1 lượt, hút sát thương bằng 70% lượng trị liệu",},
        [3845] = {8113010,"","[Nhật-Hỏa Long] Hiệu quả trị liệu tăng 25% đối với mục tiêu bị cấm trị liệu, giúp mục tiêu thêm 1 hộ thuẫn hút sát thương liên tục trong 1 lượt, hút sát thương bằng 100% lượng trị liệu",},
        [3846] = {8121010,"","[Chiếu Dạ] Khi chiến đấu mỗi lượt bị giảm tối đa 2 nộ khí",},
        [3847] = {8122010,"","[Truy Phong-Chiếu Dạ] Trước khi chiến đấu bị giảm tối đa 1 nộ khí, Khi chiến đấu mỗi lượt bị giảm tối đa 2 nộ khí",},
