        [3851] = {8153010,"","[Trục Nhật-Bôn Lôi] HP tối đa tăng 45%. Trong chiến đấu lần đầu chịu ST chí mạng sẽ không tử vong và hồi HP bằng 60% HP tối đa, bản thân hồi 4 nộ.",},
        [3852] = {8161010,"","[Huyết Tông] Tăng 15% sinh lực tối đa. Khi dùng kỹ năng, nếu mục tiêu đang bị Thiêu Đốt, kỹ năng lần này sẽ sát thương thêm 4% sinh lực tối đa của mục tiêu.",},
        [3853] = {8162010,"","[Phong-Huyết Tông] Tăng 30% sinh lực tối đa. Khi dùng kỹ năng, nếu mục tiêu đang bị Thiêu Đốt, kỹ năng lần này sẽ sát thương thêm 6% sinh lực tối đa của mục tiêu.",},
