        [3862] = {10010130,"Nhất Thống-Vũ Khí","Giảm 25% sát thương trực tiếp từ tướng khác, xác suất bị trúng hiệu quả bất lợi (Tê Liệt, Choáng, Câm Lặng, Thiêu Đốt, Trúng Độc, Suy Yếu, Áp Chế, Mắt Xích, Đánh Bay) giảm 12%",},
