        [3864] = {10030030,"Bá Vương Thần Uy","Tướng được bảo hộ nhận hiệu quả có lợi của Thanh Long, Chu Tước, Huyền Vũ, hiệu quả tăng thêm 50% (Không tăng thêm nộ)",},
        [3865] = {10030130,"Bá Vương Thần Uy-Vũ Khí","Tướng được bảo hộ nhận hiệu quả có lợi của Thanh Long, Chu Tước, Huyền Vũ, hiệu quả tăng thêm 75% (Không tăng thêm nộ)",},
        [3866] = {10030230,"Bá Vương Thần Uy-Thức Tỉnh","Tướng được bảo hộ nhận hiệu quả có lợi của Thanh Long, Chu Tước, Huyền Vũ, hiệu quả tăng thêm 100% (Tăng thêm 1 nộ)",},
        [3867] = {10040030,"Mỹ Nhân Như Ngọc","Tướng được bảo hộ nhận hiệu quả Ngự Giáp bằng 36% HP tối đa.",},
