        [3869] = {10040230,"Mỹ Nhân Như Ngọc-Thức Tỉnh","Tướng được bảo hộ nhận hiệu quả Ngự Giáp bằng 36% HP tối đa. Khi chịu sát thương trực tiếp, 100% xóa 1 trạng thái Thiêu Đốt hoặc Trúng Độc, có 50% xóa 1 trạng thái Áp Chế hoặc Suy Yếu",},
