        [3878] = {11010301,"Vũ khí 1","Khi tấn công mục tiêu đang bị khống chế (Choáng, Câm Lặng, Tê Liệt) sẽ tăng 15% ST.",},
        [3879] = {11010302,"Vũ khí 2","Khi tấn công lần lượt 1/2/3/4/6 mục tiêu, khiến mục tiêu chịu thêm sát thương bằng 15%/7.5%/5%/3.75%/2.5% HP tối đa",},
