        [3887] = {11030302,"Hộ Giáp 2","Sau khi hành động giúp bản thân nhận 1 thuẫn hút ST bằng 15% HP tối đa, duy trì 1 lượt.",},
        [3888] = {11030303,"Hộ Giáp 3","Khi tử vong, giúp đồng đội HP thấp nhất nhận 1 thuẫn vô địch, duy trì 1 lượt (Tương đương hộ thuẫn Trương Hợp đột phá 5)",},
        [3889] = {11030304,"Hộ Giáp 4","Khi chịu sát thương tướng, nếu sát thương cao hơn 50% sinh lực tối đa bản thân sẽ giảm 30% sát thương lần này",},
        [3890] = {11040301,"Giày 1","Sau khi thi triển kỹ năng, có 50% giúp xác suất bị khống chế (Choáng, Câm Lặng, Tê Liệt) của đồng đội giảm 35%, duy trì 1 lượt",},
        [3891] = {11040302,"Giày 2","Trong lượt bản thân, vừa hồi nộ vừa hồi HP bằng 15% HP tối đa",},
        [3892] = {11040303,"Giày 3","Khi kết thúc lượt, nếu trong lượt không hành động, nhận 1 hộ thuẫn miễn khống chế (Choáng, Câm Lặng, Tê Liệt), duy trì 1 lượt.",},
        [3893] = {11040304,"Giày 4","Trước khi bắt đầu lượt, có 25% xóa hiệu quả bất lợi của bản thân (Thiêu Đốt, Trúng Độc, Choáng, Câm Lặng, Tê Liệt)",},
        [3894] = {12010101,"Hộ Giáp 1","Khi diệt mục tiêu, 25% sát thương dôi ra sẽ gây sát thương mục tiêu địch sinh lực thấp nhất",},
        [3895] = {12010102,"Hộ Giáp 2","Khi dùng kỹ năng hồi nộ cho tướng khác phe ta, có xác suất giúp mục tiêu tăng 16% sát thương (Mỗi hồi 1 nộ, xác suất tăng 25%), duy trì 1 lượt. Mỗi lượt chỉ kích hoạt 1 lần.",},
        [3896] = {12010103,"Hộ Giáp 3","Khi tướng trị liệu dùng kỹ năng, 32% xóa hết trạng thái bất lợi (Trúng Độc, Thiêu Đốt)",},
        [3897] = {12010104,"Hộ Giáp 4","Nếu tấn công chưa hạ được mục tiêu, X% tổng sát thương sẽ gây thêm sát thương lên mục tiêu ở vị trí số 1. (Khi phạm vi tấn công thực tế là 6/5/4/3/2/1, X sẽ lần lượt bằng 2/2.5/3/4/6/12)",},
        [3898] = {12010201,"Giày 1","Khi tướng trị liệu dùng kỹ năng, tăng cho tướng khác sinh lực thấp nhất phe ta hiệu quả Ngự Giáp bằng 18% sinh lực tối đa",},
        [3899] = {12010202,"Giày 2","Trước mỗi lượt hành động, bản thân nhận hiệu quả Ngự Giáp bằng 18% sinh lực tối đa.",},
        [3900] = {12010203,"Giày 3","Tướng phe ta tử vong, bản thân hồi 50% sinh lực tối đa",},
        [3901] = {12010204,"Giày 4","Khi chịu sát thương trực tiếp từ tướng khác, chuyển 25% sát thương thành Ngự Giáp cho bản thân",},
        [3902] = {13050001,"Kiên Thủ","Sát thương chịu trực tiếp giảm 10%",},
        [3903] = {13050002,"Cường Công","Tăng sát thương trực tiếp 10%",},
        [3904] = {13050003,"Bạo Ngược","Khi Tướng địch bị giảm nộ, bản thân hồi phục 1 nộ (Mỗi lượt tối đa không quá 2 điểm)",},
        [3905] = {13050004,"Di Kế","Khi tử vong sẽ x2 nộ khí còn lại của bạn thân và chia đều cho Tướng phe ta, tối thiếu nhận 1 nộ khí",},
        [3906] = {13050005,"Khiêu Khích","Khi lượt này chịu tấn công của cùng 1 Võ Tướng, mỗi khi bị tấn công thêm 1 lần, sát thương bản thân phải chịu giảm 15%",},
        [3907] = {13050006,"Khích Tướng","Khi cả lượt phe ta kết thúc, bản thân tăng 8% sát thương, có thể cộng dồn, tối đa không quá 24%, duy trì đến khi kết thúc chiến đấu",},
        [3908] = {13050007,"Lui Thủ","Thi triển kỹ năng, nếu Võ Tướng địch không chịu hiệu quả khống chế, hoàn trả 50% nộ khí kỹ năng đã tiêu hao, tối đa 2 điểm.",},
        [3909] = {13050008,"Quan Đường","Khi hết lượt, Võ Tướng phe ta mỗi lần hành động trong lượt, bản thân hồi phục HP bằng 5% HP tối đa",},
        [3910] = {13050009,"Nộ Hỏa","Mỗi võ tướng phe mình tử vong, sát thương bản thân tăng 12%, tối đa không quá 24% duy trì đến khi kết thúc chiến đấu",},
        [3911] = {13050010,"Xảo Biến","Khi cả lượt phe ta kết thúc, nếu HP dưới 50%, hồi HP bằng 24% HP tối đa bản thân. Nếu HP không dưới 50%, tăng 10% sát thương bản thân, duy trì 1 lượt",},
        [3912] = {13050011,"Kỳ Tập","Đánh thường giúp bản thân hồi phục thêm 1 nộ",},
        [3913] = {13050012,"Liệt Nhẫn","Khi tấn công mục tiêu bị Thiêu Đốt, bản thân hồi thêm 1 nộ",},
        [3914] = {13050013,"Nhìn Thấu","Khi tấn công mục tiêu địch bị Tê Liệt, Trúng Độc, Câm Lặng, Choáng, tăng thêm 15% sát thương.",},
        [3915] = {13050014,"Thần Tốc","Sát thương Truy Kích tăng 15%",},
        [3916] = {13050015,"Dũng Quyết","Nếu bản thân ở trạng thái Trúng Độc, Thiêu Đốt, Choáng, Tê Liệt, Câm Lặng, Áp Chế, Suy Yếu, sát thương trực tiếp Tướng phải chịu giảm 15%.",},
        [3917] = {13050016,"Phùng Xuân","Trong thời gian duy trì trị liệu, có 25% nhận 1 điểm nộ.",},
        [3918] = {13050017,"Vương Tá","Khi thi triển kỹ năng sẽ khiến mục tiêu có nhiều nộ khí nhất phe địch giảm 2 nộ khí.",},
        [3919] = {13050018,"Khai Dương","Khi dùng kỹ năng, bản thân hồi thêm 1 nộ",},
        [3920] = {13050019,"Linh Phách","Thi triển kỹ năng xóa hiệu quả Trúng Độc, Thiêu Đốt, Choáng, Tê Liệt, Câm Lặng của Võ Tướng có HP thấp nhất phe ta",},
        [3921] = {13050020,"Viễn Lự","Trước khi hành động, nếu nộ khí bản thân dưới 4, lượt này không hành động và khi kết thúc lượt bản thân sẽ hồi phục 4 nộ",},
        [3922] = {13060001,"Kỳ Mưu Sách","Khi phe địch bị hiệu quả Choáng, Tê Liệt, Câm Lặng, Áp Chế, bản thân nhận Buff ST 12%, tối đa không quá 24%, duy trì 1 lượt",},
        [3923] = {13060002,"Lung Linh Tâm","Mỗi lượt né tránh kỹ năng Võ Tướng sát thương phe địch lần đầu. (Ưu tiên hiệu quả chắc chắn chính xác cấp cao hôn tấn công của địch)",},
        [3924] = {13060003,"Dương Quân Uy","Khi kỹ năng tốn nhiều nộ khí hơn lượt hiện tại, giải trừ hiệu quả Trúng Độc, Thiêu Đốt, Choáng, Tê Liệt, Câm Lặng cho mục tiêu có sinh lực thấp nhất phe mình, khi kỹ năng tốn nộ không vượt hơn lượt hiện tại, sát thương kỹ năng lần này tăng 15%",},
        [3925] = {13060004,"Tẩu Vi Thượng","Khi bị sát thương kỹ năng đơn từ tướng địch, hồi 24% sinh lực tối đa.",},
        [3926] = {13060005,"Bàn Thạch","Khi bản thân bị Trúng Độc, Thiêu Đốt, Choáng, Tê Liệt, Câm Lặng, Áp Chế, Suy Yếu, Đánh Bay, mất 12% HP tối đa miễn dịch Trúng Độc, Thiêu Đốt, Choáng, Tê Liệt, Câm Lặng; mất 18% HP tối đa miễn dịch Áp Chế, Suy Yếu, Đánh Bay. (Sát thương này không gây tử vong)",},
        [3927] = {13060006,"Lược Như Hỏa","Sát thương tăng 18%",},
        [3928] = {13060007,"Đồng Tâm Sách","Khi bản thân bị sát thương trực tiếp, giúp tất cả Võ Tướng phe ta hồi phục 1 nộ, mỗi lượt tối đa kích hoạt 2 lần. ",},
        [3929] = {13060008,"Ngưng Thần Kế","Khi sinh lực dưới 50%, bản thân lập tức xóa hiệu quả Trúng Độc, Thiêu Đốt, Choáng, Tê Liệt, Câm Lặng và hồi phục HP bằng 18% HP tối đa, mỗi lượt chỉ 1 lần",},
        [3930] = {13060009,"Phúc Cùng Hưởng","Khi cả lượt phe ta kết thúc, nếu Võ Tướng phe ta nộ khí bằng với bản thân, bản thân và mục tiêu cùng lúc hồi phục 2 nộ",},
        [3931] = {13060010,"Xa Huyền Trận","Khi thi triển kỹ năng nộ khí không đủ, lấy nộ khí của Võ Tướng khác cùng phe có nộ khí cao nhất, mỗi lấy 1 nộ khí, sát thương tăng 12%, tối đa không quá 36% (Chỉ lấy Võ Tướng phe ta có nộ khí trên 4, sau khi lấy nộ khí nếu vẫn không đủ để thi triển kỹ năng sẽ không lấy)",},
        [3932] = {13060011,"Như Bàn Thạch","Sát thương chịu trực tiếp giảm 15%",},
        [3933] = {13060012,"Nắm Rõ","Khi tấn công, kèm trạng thái trọng thương cho địch, giảm 50% tất cả hiệu quả trị liệu trừ hiệu quả trị liệu do Tướng tạo ra, duy trì 1 lượt.",},
        [3934] = {13070001,"Thiên Hựu","Khi nhận hiệu quả có lợi do Thần Thú (Thanh Long, Huyền Vũ, Chu Tước) thi triển, hiệu quả tăng gấp đôi",},
        [3935] = {13070002,"Khí Định Thần Nhàn","Miễn dịch hiệu quả bất kỳ do Thần Thú địch gây ra (Chỉ miễn dịch 1 lần Lưu Đày của Bạch Trạch)",},
        [3936] = {13070003,"Giấu Tài","Nếu lượt này bản thân không hành động, hồi 2 nộ và nhận Hộ Thuẫn miễn dịch hiệu quả bất lợi (Trúng Độc, Thiêu Đốt, Choáng, Tê Liệt, Câm Lặng, Áp Chế, Suy Yếu, Đánh Bay, Trục Xuất), duy trì 1 lượt",},
        [3937] = {13070004,"Liên Lý","Thi triển kỹ năng trị liệu cho mục tiêu phe mình, nếu phe mục tiêu và bản thân giống nhau sẽ tăng cho mục tiêu hiệu quả Ngự Giáp bằng 15% HP tối đa.",},
        [3938] = {13070005,"Thừa Cơ Hành Động","Khi võ tướng khác của phe mình thi triển hiệu quả Truy Kích, bản thân tăng hiệu quả Ngự Giáp tương đương 15% HP tối đa, mỗi lượt thi triển tối đa 3 lần.",},
        [3939] = {13070006,"Đánh Bất Ngờ","Trước khi hành động, nếu nộ khí bản thân dưới 4, cũng có thể thi triển kỹ năng. Nộ dưới 4, cứ giảm 1 nộ, sát thương trực tiếp giảm 15%.",},
        [3940] = {13070007,"Kiến Cố Vững Chắc","Khi bị hiệu quả Ngự Giáp ảnh hưởng, hiệu quả Ngự Giáp nhận được tăng 30%",},
        [3941] = {13070008,"Cô Mộc Phùng Xuân","Thi triển kỹ năng trị liệu cho mục tiêu, 15% lượng trị liệu dôi ra chuyển hóa thành Ngự Giáp cho mục tiêu",},
        [3942] = {13070009,"Di Hoa Tiếp Mộc","Võ Tướng khác của phe ta kkhi nhận hiệu quả xóa bất thường, bản thân cũng đồng thời nhận hiệu quả xóa bất thưởng này",},
        [3943] = {13070010,"Hỏa Thần Nộ","Khi tấn công, luôn xem địch ở trạng thái Thiêu Đốt",},
        [3944] = {13070011,"Truy Hồn Đoạt Phách","Nếu tấn công chưa hạ được mục tiêu, X% tổng sát thương sẽ gây thêm sát thương gián tiếp lên mục tiêu gần nhất. (Khi phạm vi tấn công thực tế là 6/5/4/3/2/1, X sẽ lần lượt bằng 2.5/3/3.75/5/7.5/15)",},
        [3945] = {13070012,"Tả Hữu Phong Nguyên","Khi bị Võ Tướng nam tấn công, sát thương trực tiếp giảm 20%. Khi bị Võ Tướng nữ tấn công, bản thân hồi thêm 1 nộ",},
        [3946] = {13070013,"Thiên Hựu","Khi sinh lực dưới 50%, nhận hiệu quả Ngự Giáp bằng 27% HP tới đa, mỗi lượt chỉ 1 lần",},
        [3947] = {13070014,"Linh Thần Hộ","Khi Tướng địch nhận hiệu quả Ngự Giáp trong chiến đấu, bản thân cũng tăng 25% hiệu quả Ngự Giáp địch nhận được (Hiệu quả Ngự Giáp nhận từ Chiến Pháp này không kích hoạt Chiến Pháp này lần nữa)",},
        [3948] = {13070015,"Lập Mưu","Sau khi Võ Tướng cùng phẩm chất khác của phe ta ra tay, sát thương tăng 8%, tối đa không quá 24%",},
